import React from 'react';

const MentorDashboard = () => (
  <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8 py-8">
    <h1 className="text-3xl font-bold text-secondary-900 mb-8">Mentor Dashboard</h1>
    <div className="card p-6">
      <p>Mentors can review and approve student applications, provide feedback, and track student progress.</p>
    </div>
  </div>
);

export default MentorDashboard;
